import Events from "./Events"

export default class extends Events {
    constructor(name, options) {
        super(options);
        this._name = name;
    }

    get id() {
        return this._id;
    }

    set id(value) {
        this._id = value;
    }

    get name() {
        return this._name;
    }

    set name(value) {
        this._name = value;
    }
}